import { useState } from "react";
import { TextInput, View } from "react-native"


const [data,setData]= useState();
const  Datahandle=()=>{
    return(
      <View>
        <TextInput 
        placeholder="Name"
        value={data}
        onChangeText={setData()}/>
        <TextInput 
        placeholder="Name"
        value={data}
        onChangeText={setData()}/>
        <TextInput 
        placeholder="Name"
        value={data}
        onChangeText={setData()}/>
      </View>

    )
}
export default Datahandle;
